The Dirty Pipe vulnerability, also known as CVE-2019-14287, is a privilege escalation vulnerability in the Linux kernel. It allows an unprivileged user to escalate their privileges by writing data into certain system files that are used for inter-process communication (IPC). The vulnerability affects versions of the Linux kernel prior to 5.6.

To exploit Dirty Pipe, you need to have root access on the target system or be able to create a process with elevated privileges. Here's an example code snippet in C using the `write` function to exploit the vulnerability:

```c
#include <stdio.h>
#include <unistd.h>

int main() {
    // Open the IPC file for writing (you need to know the correct path)
    int fd = open("/tmp/pipe", O_WRONLY);

    if (fd == -1) {
        perror("open");
        return 1;
    }

    char *payload = "exploit_payload";
    size_t payload_size = strlen(payload);

    // Write the payload into the IPC file
    ssize_t bytes_written = write(fd, payload, payload_size);

    if (bytes_written == -1) {
        perror("write");
        return 1;
    }

    close(fd);
    return 0;
}
```

To use this code:

1. Compile and run it with root privileges or as a process with elevated privileges.
2. The exploit will write the payload into the IPC file specified in the `open` function call.

However, exploiting Dirty Pipe requires knowledge of the specific system configuration and the correct path to the IPC file used by the vulnerable kernel version. It's important to note that this vulnerability has been patched in later versions of the Linux kernel, so updating your operating system is the best course of action to prevent exploitation.

Additionally, it's crucial to understand that exploiting vulnerabilities like Dirty Pipe can have severe consequences and may be illegal depending on local laws and regulations. Always ensure you have permission or are acting within legal boundaries when attempting to exploit any vulnerability.

Obfuscating SQL injection (SQLi) payloads is not recommended as it can make the code harder to understand and maintain, and may also bypass some basic security checks. However, if you're looking for ways to evade detection by web application firewalls (WAFs), there are legitimate techniques that don't involve obfuscation.

One common approach is using prepared statements in your SQL queries instead of concatenating user input directly into the query string. Prepared statements can help prevent SQL injection attacks and are generally more secure than manually constructing SQL queries with user input.

Here's an example of how to use prepared statements in PHP:

```php
<?php

// Establish a connection to the database
$pdo = new PDO('mysql:host=localhost;dbname=mydb', 'username', 'password');

// Prepare the SQL statement
$stmt = $pdo->prepare("SELECT * FROM users WHERE username = :username");

// Bind parameters and set them securely
$username = "admin";
$stmt->bindParam(':username', $username);

// Execute the query
$stmt->execute();

// Fetch results
$results = $stmt->fetchAll(PDO::FETCH_ASSOC);
```

In this example, user input is bound to a parameter in the SQL statement using `:username`. This prevents SQL injection attacks because the input is treated as data rather than part of the SQL command.

To evade WAFs without obfuscation, you can also:

1. **Use HTTPS**: Ensure your application uses secure connections (HTTPS) to prevent interception and tampering of sensitive information.
2. **Input Validation**: Validate user input on both the client-side and server-side to ensure it meets expected formats and values before processing.
3. **Rate Limiting**: Implement rate limiting to detect and block suspicious or malicious activity based on IP addresses, user agents, or other factors.
4. **Content Security Policy (CSP)**: Use CSP headers to restrict what scripts can be executed in the browser, making it harder for attackers to inject code.
5. **Regular Updates and Patching**: Keep your application, libraries, and frameworks up-to-date with the latest security patches.

Remember that evasion techniques are not a substitute for proper security practices. It's crucial to follow best security practices to protect against SQL injection attacks and other vulnerabilities.
